import React from "react";
import DrawPopup from './DrawPopup';
import { useState } from "react";

const Navbar = () => {
  const [showPopup, setShowPopup] = useState(false);


  return (
    <div className="navbar bg-gray-800 text-white p-4 flex items-center justify-center">
      <button
        className="p-2 bg-blue-500 rounded hover:bg-green-600"
        onClick={() => {
          console.log("t覺kladn覺");
          setShowPopup(true)}}
      >
        Add Feature
      </button>
      {showPopup &&  <DrawPopup onClose={() => setShowPopup(false)} />}
    </div>
  );
};

export default Navbar;
